import React from 'react';
import { NavLink } from 'react-router-dom';
import Button from '@material-ui/core/Button';
import {web} from "../svg"

const Home=()=> {
  return (
    
      <>
      <div className="container-fluid mb-auto">
          <div className="row">
              <div className="col-10 mx-auto  d-flex">
                  <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex flex-column">
                      <h1>Grow your business with <strong>Jaskirat Singh</strong></h1>
                      <h2 className="my-3"> we are a team of some good developer to making website</h2>
                     <div className="mt-3">
                         
                         
                    <NavLink to="/service"  ><Button variant="outlined" color="primary">Get Started</Button></NavLink> </div>
                  </div>
                  <div className="col-lg-6 order-1 order-lg-2 header_img">
                      <img className="img-fluid" src={web} alt="textimage"/>
                  </div>

              </div>
          </div>
      </div>
       
     
    </>
  );
}

export default Home;
